import queue

class Tickets:
    def __init__(self) -> None:
        self.tasks = queue.Queue()

    def createTicket(self,title, msg) -> None:
        self.tasks.put((title, msg))

    def compliteTicket(self) -> None:
        print("Ticket completed:", self.tasks.get())

    def showTicketsQueue(self):
        print("Tickets queue:")
        temp_queue = queue.Queue()
        while not self.tasks.empty():
            zadanie = self.tasks.get()
            print(zadanie)
            temp_queue.put(zadanie)

        while not temp_queue.empty():
            self.tasks.put(temp_queue.get())


tickets = Tickets()

tickets.createTicket("Bug", "Bug in internal app X")
tickets.createTicket("printer", "Printer doesn't work")

tickets.showTicketsQueue()

tickets.compliteTicket()

tickets.showTicketsQueue()
